Question.create!([
  {id: 11, title_notused: "", survey_id: 7, created_at: "2017-05-18 22:10:11", updated_at: "2017-05-18 22:47:44", qtype: "select_yes_no", question_note: "", question_whatlookfor: "", question_if_no: "", question_list_id: 2, active_status: nil, sort: nil},
  {id: 12, title_notused: "", survey_id: 7, created_at: "2017-05-18 22:19:30", updated_at: "2017-05-18 22:19:30", qtype: "select_yes_no", question_note: "Verify first off has all required information; manual data entered on sheet, nothing out of tolerance, TPC (if features are out of tolerance), CMM reports attached and FO is signed off.", question_whatlookfor: "Look for: \r\n - Process sheet has all manual entry data fields filled in and is within tolerance\r\n - CMM report is attached to the first off and all data is within tolerance limits\r\n - If out of tolerance, is a TPC issued\r\n - Ensure TPC covers out of tolerance features", question_if_no: "- Missing data; have feature measured by operator, if within\r\n   tolerance have operator complete first off sheet by entering\r\n   missing data\r\n - Missing CMM report; have operator submit parts for CMM\r\n   measurement. Ensure all features on CMM report are within\r\n   tolerance limits, attach to first off\r\n - Measured feature out of tolerance then follow non-conforming\r\n   procedure SWI-000824\r\n      - Contain material between last good check and time of\r\n        finding and generate a hold tag or;\r\n      - Generate a TPC to cover the out of tolerance condition\r\n        (if warranted).", question_list_id: 2, active_status: 0, sort: 0},
  {id: 13, title_notused: "", survey_id: 7, created_at: "2017-05-18 22:27:48", updated_at: "2017-05-18 22:27:48", qtype: "select_part_number", question_note: "", question_whatlookfor: "", question_if_no: "", question_list_id: 10, active_status: 0, sort: 0},
  {id: 14, title_notused: "", survey_id: 8, created_at: "2017-05-19 23:00:56", updated_at: "2017-07-24 17:08:51", qtype: "select_part_number", question_note: "", question_whatlookfor: "-", question_if_no: "", question_list_id: 10, active_status: 0, sort: 0},
  {id: 15, title_notused: "", survey_id: 8, created_at: "2017-05-19 23:00:56", updated_at: "2017-07-24 13:45:17", qtype: "select_process_step", question_note: "Enter the operation you are auditing. (zz)", question_whatlookfor: "", question_if_no: "", question_list_id: 11, active_status: 0, sort: 0},
  {id: 16, title_notused: "", survey_id: 8, created_at: "2017-05-19 23:00:56", updated_at: "2017-07-24 17:14:19", qtype: "select_yes_no", question_note: "(Verify process sheets are at the workstation or hanging on the machine)", question_whatlookfor: "- Correct process sheet is at the workstation or hanging on the\r\n   machine", question_if_no: "- Acquire correct process sheet and post at station\r\n - Show operator where to get correct process sheet (Windchill)", question_list_id: 1, active_status: 0, sort: 0},
  {id: 17, title_notused: "", survey_id: 8, created_at: "2017-05-19 23:00:56", updated_at: "2017-07-24 15:17:27", qtype: "select_yes_no", question_note: "Verify first off has all required information; manual data entered on sheet, nothing out of tolerance, TPC (if features are out of tolerance), CMM reports attached and is signed off.", question_whatlookfor: "- Process sheet has all manual entry data filled in and is\r\n   within tolerance limits\r\n - CMM report is attached to first off and all data is within\r\n   tolerance limits\r\n - If out of tolerance, is a TPC issued\r\n - Ensure TPC covers out of tolerance features", question_if_no: "- Missing data; have feature measured by operator, if within\r\n   tolerance have operator complete first off sheet by entering\r\n   missing data\r\n - Missing CMM report; have operator submit parts for CMM\r\n   measurement. Ensure all features on CMM report are within\r\n   tolerance limits, attach to first off\r\n - Measured feature out of tolerance then follow non-conforming\r\n   procedure SWI-000824\r\n      - Contain material between last good check and time of\r\n        finding and generate a hold tag or;\r\n      - Generate a TPC to cover the out of tolerance condition\r\n        (if warranted).", question_list_id: 2, active_status: 0, sort: 0},
  {id: 18, title_notused: "", survey_id: 8, created_at: "2017-05-19 23:00:56", updated_at: "2017-07-24 17:14:19", qtype: "select_yes_no", question_note: "Verify operator is following the process steps outlined in the SWI, watch what they do.", question_whatlookfor: "- Watch the operator doing the job and see if they match what\r\n    is posted on the SWI", question_if_no: "- Ask operator why they do it differently from SWI\r\n - Document the operators response\r\n - If what the operator is doing makes sense, allow them to\r\n   continue;\r\n      - Generate a TPC to cover the change in process steps.\r\n - Mark up SWI and submit change request to the SPS group\r\n   (D. Miller, D. Gleba) for modification and distribution.", question_list_id: 3, active_status: 0, sort: 0},
  {id: 19, title_notused: "", survey_id: 8, created_at: "2017-05-19 23:00:56", updated_at: "2017-07-24 15:08:03", qtype: "select_yes_no", question_note: "Pick a manually measured feature on the process sheet and have the operator perform the inspection. Check that they are using the proper gauge and that they measure it correctly.", question_whatlookfor: "- Ensure OIS checks are completed at the proper frequency per\r\n   the OIS sheet (for all features)\r\n - Ensure operator is using the correct gauge for checking the\r\n   feature selected\r\n - Ensure operator knows how to use the gauge to correctly\r\n   measure the feature\r\n - Ensure feature being measured is measured correctly\r\n - Ensure feature being measured is within tolerance limits on\r\n   the process sheet\r\n - Ensure OIS is being saved with each first off (OIS stapled to\r\n   first off).", question_if_no: "- Instruct operator on importance of OIS checks and ask why\r\n   checks weren't completed per the frequency\r\n - Have operator complete required OIS checks, verify features\r\n   are within tolerance limits, follow non-conforming procedure if\r\n   they are not\r\n - Verify proper gauge as per process sheet is available (if not\r\n   then get the correct gauge)\r\n - Instruct operator on proper use of the gauge\r\n - Instruct operator on correct measuring technique for feature\r\n   being measured.\r\n - Verify measurement on another gauge or CMM (if applicable),\r\n   if still out of tolerance then follow non-conforming procedure\r\n   SWI-000824\r\n      - Contain material between last good check and time of\r\n        finding and generate a hold tag or;\r\n      - Generate a TPC to cover the out of tolerance condition\r\n        (if warranted).", question_list_id: 4, active_status: 0, sort: 0},
  {id: 20, title_notused: "", survey_id: 8, created_at: "2017-05-19 23:00:56", updated_at: "2017-05-19 23:21:46", qtype: "short_answer", question_note: "Record the feature number and measured value in the space provided (like this:98, 2.346).", question_whatlookfor: "", question_if_no: "", question_list_id: 5, active_status: 0, sort: 0},
  {id: 21, title_notused: "", survey_id: 8, created_at: "2017-05-19 23:00:56", updated_at: "2017-07-24 17:14:19", qtype: "select_yes_no", question_note: "Verify that all gauges listed on the process sheet are at the workstation for operator use. ", question_whatlookfor: "- Check gauges at the station against the gauges listed on the\r\n   process sheet, ensure they match", question_if_no: "- If there are additional gauges at the workstation that are not\r\n   listed on the process sheet or a TPC/SI, ask why they are\r\n   there, remove them and give to gauge tech\r\n - If there is a gauge missing that is required, acquire the correct\r\n   gauge (important to look and see if operator has checked off\r\n   OIS sheet. If so, ask how they checked it).\r\n - Measure feature (for missing gauge) with correct gauge and\r\n   verify measurement is within tolerance limits\r\n - If not within tolerance limits then;\r\n      - Contain material between last good check and time of\r\n        finding and generate a hold tag or;\r\n      - Generate a TPC to cover the out of tolerance condition\r\n        (if warranted).", question_list_id: 6, active_status: 0, sort: 0},
  {id: 22, title_notused: "", survey_id: 8, created_at: "2017-05-19 23:00:56", updated_at: "2017-05-19 23:21:46", qtype: "short_answer", question_note: "Record the gauge numbers in the space provided (Like this: SDG-402, DHG-12, MO1-392)", question_whatlookfor: "", question_if_no: "", question_list_id: 6, active_status: 0, sort: 0},
  {id: 23, title_notused: "", survey_id: 8, created_at: "2017-05-19 23:00:56", updated_at: "2017-07-24 17:14:19", qtype: "select_yes_no", question_note: "Ensure the trace tag is filled out at the start of the bin not when the bin is complete.", question_whatlookfor: "- Ensure traceability tags are completed for all operations up to\r\n   and including the operation being audited\r\n - Ensure all parts at workstation have traceability tags\r\n   completed properly.", question_if_no: "- If tracetag information not completed properly;\r\n      - Speak to operator and have them complete tracetag and\r\n        attached to bin of material\r\n - If tracetag information not completed properly (from previous\r\n   operation(s));\r\n      - Speak to operator at previous operation(s) where\r\n        traceability became unknown (where the trace tag was not\r\n        completed)\r\n      - Try to determine traceability information and have tag\r\n        completed (if possible)\r\n - If not possible to determine traceability information then;\r\n      - Follow non-conforming procedure SWI-000824, generate a\r\n        hold tag, put material in quarantine area for management\r\n        review", question_list_id: 7, active_status: 0, sort: 0},
  {id: 24, title_notused: "", survey_id: 8, created_at: "2017-05-19 23:00:56", updated_at: "2017-07-24 17:14:19", qtype: "select_yes_no", question_note: "Verify operator awareness by asking them about any issues they are aware of and then reviewing any alerts, TPC's, SI's posted at the workstation to see if they match.", question_whatlookfor: "- Look for any Quality Alerts, TPC's, Special Instructions posted\r\n   at the workstation\r\n - Determine if operator is aware by asking an open ended\r\n   question about any issues they are having\r\n   (i.e. what issues are you having at this operation? or; are you\r\n   aware of any quality alerts or special instructions?)", question_if_no: "- Review Quality Alert, TPC, Special Instructions with the\r\n   operator so that they will be aware\r\n - Remind operator to review all documentation at the workstation\r\n   prior to the start of his shift so that he is aware of any issues", question_list_id: 8, active_status: 0, sort: 0},
  {id: 25, title_notused: "", survey_id: 8, created_at: "2017-05-19 23:00:56", updated_at: "2017-07-24 17:14:19", qtype: "select_yes_no", question_note: "Verify that error proofing checks have been completed and that all required red rabbits are available and in their proper location. If one is missing there should be and orange tag in place to show that the red rabbit is in QA Lab for repair.", question_whatlookfor: "- Review log sheet posted at workstation to see when last\r\n   check was done\r\n - Look back at some dates on the sheet to ensure checks are\r\n   being done at the required frequency\r\n - Verify all red rabbits are accounted for and in their proper\r\n   storage location, or that missing red rabbit locations are\r\n   tagged  properly and that a TPC is present.", question_if_no: "- Review with operator the requirement for error proofing checks\r\n - Have operator perform the checks and ensure they fail as\r\n   required\r\n - If a red rabbit passes when it should have failed contact the\r\n   Gauge Tech on shift to have the red rabbit removed and\r\n   repaired or replaced;\r\n      - Ensure place holder for the red rabbit being repaired or\r\n        replaced has an orange tag in place identifying that the red\r\n        rabbit is in QA (reference SWI-12004)\r\n      - Generate a TPC to cover the fact that a check has been\r\n        by-passed and notify upstream workstations of the TPC", question_list_id: 9, active_status: 0, sort: 0},
  {id: 26, title_notused: "", survey_id: 9, created_at: "2017-06-07 23:45:36", updated_at: "2017-06-07 23:57:28", qtype: "select_part_number", question_note: "", question_whatlookfor: "", question_if_no: "", question_list_id: 10, active_status: 0, sort: 0},
  {id: 27, title_notused: "", survey_id: 9, created_at: "2017-06-07 23:45:36", updated_at: "2017-06-07 23:57:28", qtype: "short_answer", question_note: "", question_whatlookfor: "", question_if_no: "", question_list_id: 11, active_status: 0, sort: 0},
  {id: 28, title_notused: "", survey_id: 9, created_at: "2017-06-07 23:45:36", updated_at: "2017-06-07 23:57:28", qtype: "select_yes_no", question_note: "Verify process sheets are at the workstation or hanging on the machine.", question_whatlookfor: "", question_if_no: "", question_list_id: 1, active_status: 0, sort: 0},
  {id: 29, title_notused: "", survey_id: 9, created_at: "2017-06-07 23:45:36", updated_at: "2017-06-07 23:57:28", qtype: "select_yes_no", question_note: "Verify first off has all required information; manual data entered on sheet, nothing out of tolerance, TPC (if features are out of tolerance), CMM reports attached and is signed off.", question_whatlookfor: "", question_if_no: "", question_list_id: 2, active_status: 0, sort: 0},
  {id: 30, title_notused: "", survey_id: 9, created_at: "2017-06-07 23:45:36", updated_at: "2017-06-07 23:57:28", qtype: "select_yes_no", question_note: "Verify operator is following the process steps outlined in the SWI, watch what they do.", question_whatlookfor: "", question_if_no: "", question_list_id: 3, active_status: 0, sort: 0},
