  {id: 33, title_notused: "", survey_id: 9, created_at: "2017-06-07 23:45:36", updated_at: "2017-06-07 23:57:28", qtype: "short_answer", question_note: "Verify that all gauges listed on the process sheet are at the workstation for operator use. Record all the gauge numbers here (like this: DHG-123, SP-112).", question_whatlookfor: "", question_if_no: "", question_list_id: 6, active_status: 0, sort: 0},
  {id: 34, title_notused: "", survey_id: 9, created_at: "2017-06-07 23:45:36", updated_at: "2017-06-07 23:57:28", qtype: "select_yes_no", question_note: "Ensure the trace tag is filled out at the start of the bin not when the bin is complete.", question_whatlookfor: "", question_if_no: "", question_list_id: 7, active_status: 0, sort: 0},
