  {id: 36, title_notused: "", survey_id: 9, created_at: "2017-06-07 23:45:36", updated_at: "2017-06-07 23:57:28", qtype: "select_yes_no", question_note: "Verify that error proofing checks have been completed and that all required red rabbits are available and in their proper location. If one is missing there should be and orange tag in place to show that the red rabbit is in QA Lab for repair. Verify a TPC has been written and posted.", question_whatlookfor: "", question_if_no: "", question_list_id: 9, active_status: 0, sort: 0},
  {id: 37, title_notused: "", survey_id: 9, created_at: "2017-06-07 23:45:36", updated_at: "2017-06-07 23:57:28", qtype: "select_yes_no", question_note: "Ensure OIS sheets are being stapled to the first off / last off.", question_whatlookfor: "", question_if_no: "", question_list_id: 12, active_status: 0, sort: 0},
